/**
 * Copies items from the given iterable into an array
 */
export declare function copyIntoAnArray<T>(iterable: Iterable<T>): any[];
/**
 * Creates an iterable from given generator function
 *
 * @param generatorFn
 * @param args
 */
export declare const iterableFromGenerator: <TItem>(generatorFn: Function, args?: any[] | undefined) => Iterable<TItem>;
